import React from 'react';
import { Register } from '../Register';

export const SignUp = ({ navigation }) => {
	return(
		<div id="Sign">
			<button type="button" className="Button_Sign" onClick={() => navigation.previous()}>Log In</button>
			<Register/>
		</div>
	);
};
